var tipuesearch = {"pages": [{'title': 'About', 'text': '倉儲: https://github.com/mdecourse/cdbw13-1 \n group:1 \n Repository:\xa0 40723201 \xa0 | Site: \xa0 40723201 Repository:\xa0 40723230 \xa0 | Site: \xa0 40723230 Repository:\xa0 40723206 \xa0 | Site: \xa0 40723206 ---- group:2 \n Repository: \xa0 40732331 \xa0 | Site: \xa0 40732331 Repository: \xa0 40723237 \xa0 | Site: \xa0 40723237 Repository: \xa0 40723228 \xa0 | Site: \xa0 40723228 ---- group:3 \n Repository:\xa0 40723227 \xa0 | Site: \xa0 40723227 Repository:\xa0 40739214 \xa0 | Site: \xa0 40739214 Repository:\xa0 40723233 \xa0 | Site: \xa0 40723233 ---- group:4 \n Repository:\xa0 40723245 \xa0 | Site: \xa0 40723245 Repository:\xa0 40723234 \xa0 | Site: \xa0 40723234 Repository:\xa0 40723232 \xa0 | Site: \xa0 40723238 \n \n', 'tags': '', 'url': 'About.html'}, {'title': 'group1', 'text': '', 'tags': '', 'url': 'group1.html'}, {'title': '40723201', 'text': '', 'tags': '', 'url': '40723201.html'}, {'title': '40723230', 'text': '', 'tags': '', 'url': '40723230.html'}, {'title': '40723206', 'text': '', 'tags': '', 'url': '40723206.html'}, {'title': 'group2', 'text': '', 'tags': '', 'url': 'group2.html'}, {'title': '40732331', 'text': '', 'tags': '', 'url': '40732331.html'}, {'title': '40723237', 'text': '', 'tags': '', 'url': '40723237.html'}, {'title': '40723228', 'text': '', 'tags': '', 'url': '40723228.html'}, {'title': 'group3', 'text': '', 'tags': '', 'url': 'group3.html'}, {'title': '40723227', 'text': 'IPv4 Ubuntu對外連線設定操作 \n 操作影片: 操作步驟: 1.點選檔案->喜好設定->網路->新增一個新的NAT網路。 2.編輯NAT網路->點選連接埠轉送->新增4個新的連接埠轉送埠號。 3.設定主機IP為 127.0.0.1 ；客體IP為 10.0.2.4 ；主機連接埠為 22、19999、17443、18443 ；客體連接埠為 22、19999、7443、8443 。 4.點選設定->網路->設定主機網路為NAT Network。 5.設定完後，點選啟動，接著輸入密碼 kmol2020 。 6.開啟LXTermial，輸入 ifconfig ->輸入 sudo apt install net-tools ->輸入密碼 kmol2020 。 7.cd tmp->ls->輸入ping 127.0.0.1測試->cd cd2020pj1->git pull。 8.接著輸入 sudo vi wsgi.py 編輯內容，按 i 進行編輯。 9.將近端的host改為 10.0.2.4 ，接著按 Esc 並輸入 :wq 存儲。 10.開啟leo，並開啟cd2020pj1.leo，點選Nav搜尋 allowExt 。 11.點選fileuploadfrom，並將第10行新增一個ttt檔，完成後存儲並關閉leo。 12.cd..,接著在tmp下新增oauth_scrum.txt，輸入 sudo vi oauth_scrum.txt 。 13.按 i 編輯，內容先隨便輸入，接著按 Esc 並輸入 :wq 存儲。 14.cd cd2020pj1，並輸入 python3 wsgi.py 啟動。 15.網址為 https:/127.0.0.1:18443/alogin 。 16.帳號及密碼都為 admin ，進入後點選fileuploadform，點選要上傳的ttt檔。 17.點選download list檢查檔案是否上傳完成。 18.完成。 \n IPv6 Ubuntu對外連線設定操作 1.設定ipv6及主機網絡nat working 2.開啟ubnutu後開啟Lxtermialermial並且輸入cd /etc 3.按照路徑進入cd apt > cd apt.conf.d 4.pt > cd apt.conf.d 5.輸入sudo vi proxy.conf輸入密碼kmol202011並且以i鍵進入編輯模式 6.輸入Acquire::http::proxy "http://[2001:288:6004:17::53]:3128"; 7.按下esc並且使用:wq來儲存，再用sudo apt update apt update來更新apt 8.ifconfig>sudo apt install net-tools，cd etc/netplan 9.輸入sudo vi 00-installer-config.yaml並且按照影片中的方式更改縮排 10.輸入ping6 2001:288:6004:17::254對外部網路測試是否可以連線 11.新增埠號 12.輸入ifconfig 來查詢在ipv6下的guest 13.輸入sudo vi wsgi.py wsgi.py將近端的host更改成:: 14.輸入python3 wsgi.py 15.用平常開啟近端的方式https://[::1]:18443若要從後門啟動的話加一個/alogin 16.打開leo新增ttt檔案的上傳設定 17.測試是否可以上傳 18.完成 \n Assignment3 \n PDF檔連結 : https://drive.google.com/open?id=1MHOYaFn9Du7UnhU9cJ0GqIthIQQSc4t4 \n', 'tags': '', 'url': '40723227.html'}, {'title': '40739214', 'text': '', 'tags': '', 'url': '40739214.html'}, {'title': '40723233', 'text': '\n', 'tags': '', 'url': '40723233.html'}, {'title': 'group4', 'text': '', 'tags': '', 'url': 'group4.html'}, {'title': '40723245', 'text': '', 'tags': '', 'url': '40723245.html'}, {'title': '40723234', 'text': 'IPV4 Ubuntu 對外連線 1.新增整體系統埠號，主機網路為NAT Network 2.啟動，password "kmol2020"，open LXTermmial 3.輸入ifconfig/sudo apt install net-tools，password "kmol2020" 4.輸入ping 127.0.0.1，進入cd2020pj1/git pull 5.sudo vi wsgi.py編輯內容，按i編輯，近端的host 改 為10.0.2.4 6.esc ，"wq" to save，開啟cd2020pj1，.leo，在nav search "allowExt" 7.新增 ttt檔，然後在tmp下sudo vi oauth_scrum.txt 8.輸入內容，輸入python3 wsgi.py 去啟動遠端 9.https:/127.0.0.0.1.1.8443/alogin \n IPV6 ubnutu 對外連線 1.setting ipv6 主機網路為NAT Network 2.start up，open Lxtermialermial input cd /etc 3.進入cd apt / cd apt.conf.d 4.pt / cd apt.conf.d 5.input sudo vi proxy.conf，password "kmol202011"，以i進編輯頁 6.input Acquire::http::proxy "http://[2001:288:6004:17::53]:3128"; 7.esc ，"wq" to save，開啟cd2020pj1，.leo，在nav search "allowExt" 8.ifconfig / sudo apt install net-tools，cd etc/netplan 9.input sudo vi 00-installer-config.yaml 並且更改縮排 10.input ping6 2001:288:6004:17::254 測試外部網路連線狀況 11.Add port number 12.input ifconfig 來查詢在ipv6下的guest 13.input sudo vi wsgi.py wsgi.py將近端的host更改成:: 14.input python3 wsgi.py 15.開啟近端的方式https://[::1]:18443 16.leo 新增ttt檔案的上傳設定 17.test \n 心得: \n 這是一次遠端連線的教學，Ubuntu的使用與學習讓我們知道Linux的易用性，在這一週的抽籤，以這種第一次沒中，第二次中籤這種峰迴路轉的方式，讓我明白，平時準備的重要性，平時沒有準備或準備不足，就會照成今日的手忙腳亂。 \n meeting by 40723210(Ubuntu) \n https://www.youtube.com/watch?v=is_sLTLHV5M&feature=emb_title \n \n', 'tags': '', 'url': '40723234.html'}, {'title': '40723232', 'text': '\n', 'tags': '', 'url': '40723232.html'}]};